import React from "react";
import logo from "../assets/img/logo.jpg"; // Adjust if needed

function Home() {
  return (
    <section className="bg-[#0f0f0f] text-white py-20 px-[10%] text-center">
      {/* Logo at the top */}
      <div className="flex justify-center mb-10">
        <img src={logo} alt="ConVINCE Logo" className="h-32 w-auto" />
      </div>

      {/* Welcome Title */}
      <h2 className="text-4xl text-[#ffcc70] mb-12">Welcome to ConVINCE Portfolio</h2>

    </section>
  );
}

export default Home;
